import ListChat from "./listchat";
import Message from "./message";

con

localStorage.setItem()

function ChatContent() {
    return (
        <div className="bodycontent">
            <div className="namecontent"><span>Chat</span></div>
            <div className="frame">
                <ListChat />
                <Message />
            </div>
        </div>
    );
}

export default ChatContent;
